class Cringe:
    def __init__(self):
        super().__init__()
        self.window = Tk()
        self.window.wm_title("Cringe")
        self.soundEffect = True
        if not exists("cringe.ogg"): open("cringe.ogg", "wb").write(cringe)
        init()
        if self.soundEffect:
            self.cringeSound = Sound("cringe.ogg")
        else:
            music.load("cringe.ogg")
        screen_width, screen_height = self.window.winfo_screenwidth(), self.window.winfo_screenheight()
        window_width, window_height = 200, 200
        self.window.resizable(False, False)
        self.window.geometry("{}x{}+{}+{}".format(window_width, window_height, int(screen_width / 2 - window_width / 2),
                                                  int(screen_height / 2 - window_height / 2)))
        Button(master=self.window, text="Cringe", width=10, height=5,
               command=self.cringePlay).place(relx=0.5, rely=0.5, anchor=CENTER)
        self.window.mainloop()

    def cringePlay(self):
        if self.soundEffect:
            self.cringeSound.play()
        else:
            music.play()


if __name__ == '__main__': tkWin = Cringe()
